import React from "react";

// export a home page component
export default class Items extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
        listitems: ["sa", ["b", "b"], "c"]
    };
  }

  render() {
    return (
        <div className="listitem">
        {this.state.listitems.map((listitem, index) => (
          <div className="item" key={index}>
            {Array.isArray(listitem) ?  
                    <div className="itemColumn">{listitem.map((item, index) => (<div key={index}>{item}</div>))}</div>: listitem}
          </div>
        ))}
      </div>
        );
  }
}
